import React,{Fragment,useEffect, useState,useRef } from 'react';
import {Link} from 'react-router-dom';
import { Table, Pagination, Badge, Dropdown } from "react-bootstrap";

import { MDBDataTable } from 'mdbreact';
import Dropdownblog2 from './Dropdownblog2';
import axios from "axios";

const Order = () => {

    
    
    //for retriving data using laravel API
    const [fetchData,setFetchData]=useState([]);
    const [loading, setLoading]=useState(true);
    
    useEffect( () => {
        axios.get('/api/GetBaskets').then(res => {
            if(res.data.status === 200){
                setFetchData(res.data.fetchData);
            }
            setLoading(false);
          });
      }, []);

    var viewProducts_HTMLTABLE = "";
    if(loading){
        return <h4>Loading...!</h4>
    }else{
        viewProducts_HTMLTABLE = 
        fetchData.map((item,i)=>{
            return (
                <tr key={item.id}>
                    <td>{i+1}</td>
                    <td>{item.VariationName}</td>
                    <td>{item.ProductName}</td>
                    <td>{item.VariantQuantity}</td>
                    <td>{item.CountryName}</td>
                    <td>{item.CityName}</td>
                    <td>{item.user_ip}</td>
                    <td>{item.BrowserName}</td>
                    <td>{item.Status}</td>
                </tr>
            )
        })
    }
  
	return (
		<Fragment>
			<div className="col-12">
                <div className="card">
                    <div className="card-header">
                    <h4 className="card-title">Patient</h4>
                    </div>
                    <div className="card-body">
                    <Table responsive className="w-100">
                        <div id="example_wrapper" className="dataTables_wrapper">
                            <table id="example" className="display w-100 dataTable">
                                <thead>
                                    <tr>
                                        <th>#NO</th>
                                        <th>Variation Name</th>
                                        <th>Product Name</th>
                                        <th>Variant Quantity</th>
                                        <th>Country Name</th>
                                        <th>City Name</th>
                                        <th>user ip </th>
                                        <th>Browser Name</th>
                                        <th>Status</th>
                                        <th>Actions</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {viewProducts_HTMLTABLE}
                                </tbody>
                            </table>
                        </div>
                    </Table>
                    </div>
                </div>
            </div>
		</Fragment>
					
	);
}
export default Order;
